package main

import (
	"math"
)

// You are given a list of numbers.
// You need to return the sum of squared numbers in the given list,
// round each element in the list to the upper int(Ceiling) first.
// Examples:
// For lst = [1,2,3] the output should be 14
// For lst = [1,4,9] the output should be 98
// For lst = [1,3,5,7] the output should be 84
// For lst = [1.4,4.2,0] the output should be 29
// For lst = [-2.4,1,1] the output should be 6
func SumSquares(lst []float64) int {
	totalSum := 0

	for _, num := range lst {
		// Round each element to the upper int (Ceiling)
		ceiledNumFloat := math.Ceil(num)

		// Convert to int. Since math.Ceil returns float64,
		// and we are dealing with integers for squaring,
		// converting to int is appropriate.
		ceiledNumInt := int(ceiledNumFloat)

		// Square the rounded integer
		squaredNum := ceiledNumInt * ceiledNumInt

		// Add to the total sum
		totalSum += squaredNum
	}

	return totalSum
}
